import React from 'react';
import PropTypes from 'prop-types';
import './index.less'

const Button = ({ text, className }) => {
  <button className={ className === undefined ? 'default_btn':className +' default_btn'}>这是一个组件按钮{text}</button>
}

Button.propTypes = {
  text: PropTypes.any,
  className: PropTypes.string
};

export default Button;
